DROP TABLE IF EXISTS `recurso`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `recurso` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'identificador del recurso',
  `cupon_id` int DEFAULT NULL,
  `cliente_id` int DEFAULT NULL,
  `producto_id` int DEFAULT NULL,
  `opinion_id` int DEFAULT NULL,
  `tipo_objeto` int NOT NULL COMMENT '1: imagen, 2: video (enumeración por codigo)',
  `objeto` longblob NOT NULL COMMENT 'imagen o video',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id_UNIQUE` (`id`),
  KEY `fk_recurso_producto1_idx` (`producto_id`),
  KEY `fk_recurso_opinion1_idx` (`opinion_id`),
  KEY `fk_recurso_usuario1_idx` (`cliente_id`),
  KEY `fk_recurso_cupones1_idx` (`cupon_id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='imagenes o videos';
