DROP TABLE IF EXISTS `respuesta`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `respuesta` (
  `id` int unsigned NOT NULL AUTO_INCREMENT COMMENT 'identificador de la pregunta',
  `pregunta_id` int NOT NULL COMMENT 'referencia a la pregunta',
  `cliente_id` int NOT NULL COMMENT 'referencia al usuario',
  `comentario` longtext NOT NULL COMMENT 'respuesta del usuario',
  `validado` tinyint(1) NOT NULL COMMENT '0: no validado por moderador, 1: si validado y visible a resto usuarios',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id_UNIQUE` (`id`),
  KEY `fk_respuesta_pregunta1_idx` (`pregunta_id`),
  KEY `fk_respuesta_usuario1_idx` (`cliente_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='respuestas a una pregunta';
